import { Navigate } from "react-router-dom";

const ProtectedRoute = ({ childreen }) => {
    const isAuth = localStorage.getItem("isAuth");

    if (!isAuth !== "true") {
        return <Navigate to="/" />;
    }

    return children;
};

export default ProtectedRoute;
